After Ryan Lambert tells Katie Powers to have a nice summer she leaves the room without getting her purse however when she goes outside the room she magically has the purse. 
The next shot is of her as she goes back into the room to get her purse. 
which is now on the closet door hook rather than being on her shoulder. 
After a little dialog with Ryan she grabs the purse before leaving the room again.
